pragma solidity ^0.5.0;

import "@openzeppelin/contracts/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/access/Roles.sol";
import "@openzeppelin/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";
import "./Events.sol";

contract AssetTokenInstance {
    function balanceOf(address owner) public view returns (uint256);
    function allowance(address owner, address spender) public view returns (uint256);
    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool);
    function withdrawTo(address recipient, uint256 amount) public returns (bool);
    function digitallWithdrawTo(address sender, address recipient, uint256 amount, uint256 salt) public returns (bool);
}

contract UsersInstance {
    function getExchangeFeeValues(address userAddress) public view returns (uint8[2] memory);
    function isActive(address userAddress) public view returns (bool);
    function isSuperUser(address userAddress) public view returns (bool);
}

contract NonceTracking {
    mapping(address => uint256) internal nonces;

    modifier withNonce(address actor, uint256 nonce) {
        require(nonce > nonces[actor], "INVALID_NONCE");
        _;
        nonces[actor] = nonce;
    }

    function getNonce() public view returns (uint256) {
        return nonces[msg.sender];
    }
}

contract Exchange is NonceTracking, Ownable, Events {
    using SafeMath for uint256;
    using Roles for Roles.Role;

    Roles.Role cryptoContracts;
    Roles.Role admins;

    address public UsersContractAddress;
    address SignerAddress = 0xE6e5c6AAcE31eFa67F95624A1705ED7b8171C5BB;
    address ExchangeFeeWallet = 0x9C51b65C5608c251f3715124666bB02aB14bc3D3;
    mapping(address => uint8[2]) public priceModifiers;

    uint8[2] public cryptoExchangeFeeValues = [1, 25]; // => 4% fee; eg. amount * 1 / 25

    constructor(address usersAddress)
        public
    {
        UsersContractAddress = usersAddress;
    }

    modifier active() {
        UsersInstance u = UsersInstance(UsersContractAddress);
        require(u.isActive(msg.sender), "User is not active.");
        _;
    }

    modifier onlyAdmins() {
        require(admins.has(msg.sender), "Caller is not an admin.");
        _;
    }

    // Setters
    function addAdmins(address[] memory newAdmins) public onlyOwner {
        for(uint i = 0; i < newAdmins.length; i++) {
            admins.add(newAdmins[i]);
        }
    }

    function addCryptoContracts(address[] memory newContracts) public onlyOwner {
        for(uint i = 0; i < newContracts.length; i++) {
            cryptoContracts.add(newContracts[i]);
        }
    }

    function addPriceModifiers(address[] memory newContracts, uint8[2][] memory values) public onlyOwner {
        for(uint i = 0; i < newContracts.length; i++) {
            priceModifiers[newContracts[i]] = values[i];
        }
    }

    function setCryptoFeeValues(uint8[2] memory _newCryptoFeeValues) public onlyAdmins {
        cryptoExchangeFeeValues = _newCryptoFeeValues;
    }

    function setExchangeFeeWallet(address newAddress) public onlyAdmins {
        ExchangeFeeWallet = newAddress;
    }

    function setSignerAddress(address newAddress) public onlyAdmins {
        SignerAddress = newAddress;
    }

    function setUsersContractAddress(address newAddress) public onlyAdmins {
        UsersContractAddress = newAddress;
    }

    function feeScalar(address userAddress, address[2] memory addresses)
        public
        view
        returns (uint256[2] memory)
    {
        UsersInstance u = UsersInstance(UsersContractAddress);

        uint8[2] memory exchangeValues = u.getExchangeFeeValues(userAddress);
        uint256 p0 = priceModifiers[addresses[1]][0];
        uint256 p1 = priceModifiers[addresses[1]][1];
        uint256 e0;
        uint256 e1;
        uint256 dividend;
        uint256 divisor;

        if (u.isSuperUser(userAddress)) {
            dividend = 1;
            divisor = 1;
        } else if (cryptoContracts.has(addresses[0]) || cryptoContracts.has(addresses[1])) {
            e0 = cryptoExchangeFeeValues[0];
            e1 = cryptoExchangeFeeValues[1];
            dividend = e1.mul(p1).sub(e0.mul(p1)).sub(e1.mul(p0));
            divisor = e1.mul(p1);
        } else {
            e0 = exchangeValues[0];
            e1 = exchangeValues[1];
            dividend = e1.mul(p1).sub(e0.mul(p1)).sub(e1.mul(p0));
            divisor = e1.mul(p1);
        }

        return [dividend, divisor];
    }

    // Determine fee based on user exchange values,
    // divisor 0 exchanges for free,
    // and exchanging to or from crypto results in a 4% fee.
    function _calculateExchangeFee(address userAddress, uint256 value, address[2] memory addresses)
        internal
        view
        returns (uint256)
    {
        UsersInstance u = UsersInstance(UsersContractAddress);

        uint8[2] memory exchangeValues = u.getExchangeFeeValues(userAddress);
        uint256 priceModification = value.mul(priceModifiers[addresses[1]][0]).div(priceModifiers[addresses[1]][1]);
        uint256 fee;

        if (u.isSuperUser(userAddress)) {
            fee = 0;
        } else if (cryptoContracts.has(addresses[0]) || cryptoContracts.has(addresses[1])) {
            fee = value.mul(cryptoExchangeFeeValues[0]).div(cryptoExchangeFeeValues[1]).add(priceModification);
        } else {
            fee = value.mul(exchangeValues[0]).div(exchangeValues[1]).add(priceModification);
        }

        return fee;
    }

    function _exchangeTransfers(
        uint256[4] memory values,
        // [0] fromAmount
        // [1] toAmount
        // [2] fee
        // [3] salt
        address recipient,
        address[2] memory addresses,
        bool isExchangeAndTransfer
    )
        internal
        returns (bool)
    {
        AssetTokenInstance f = AssetTokenInstance(addresses[0]);
        AssetTokenInstance t = AssetTokenInstance(addresses[1]);

        require(f.balanceOf(msg.sender) >= values[0], "INSUFFICIENT_SENDER_TOKENS");
        require(f.allowance(msg.sender, address(this)) >= values[0], "NOT_APPROVED");
        require(t.balanceOf(addresses[1]) >= values[1], "INSUFFICIENT_CONTRACT_TOKENS");

        f.transferFrom(msg.sender, addresses[0], values[0]);
        t.withdrawTo(ExchangeFeeWallet, values[2]);
        if (isExchangeAndTransfer) {
            t.digitallWithdrawTo(msg.sender, recipient, values[1].sub(values[2]), values[3]);
        }  else {
            t.withdrawTo(recipient, values[1].sub(values[2]));
        }

        return true;
    }

    function exchange(
        uint256[3] memory exchangeValues,
        // [0] fromAmount
        // [1] toAmount
        // [2] nonce
        address[2] memory addresses,
        // [0] fromAddress
        // [1] toAddress
        bytes memory sig
    )
        public
        active
        withNonce(msg.sender, exchangeValues[2])
        returns (bool)
    {
        bytes32 message = keccak256(
            abi.encodePacked(
                exchangeValues[0],
                exchangeValues[1],
                addresses[0],
                addresses[1],
                exchangeValues[2]
            )
        );
        address signer = ECDSA.recover(message, sig);
        require(signer == SignerAddress, "Incorrect signature.");

        uint256 fee = _calculateExchangeFee(msg.sender, exchangeValues[1], addresses);
        _exchangeTransfers([exchangeValues[0], exchangeValues[1], fee, 1], msg.sender, addresses, false);
        emit Exchange(addresses[0], addresses[1], exchangeValues[0], exchangeValues[1], fee);
        return true;
    }

    function exchangeAndTransfer(
        uint256[3] memory exchangeValues,
        // [0] fromAmount
        // [1] toAmount
        // [2] nonce
        address[2] memory addresses,
        // [0] fromAddress
        // [1] toAddress
        address recipient,
        bytes memory sig,
        uint256 salt
    )
        public
        active
        withNonce(msg.sender, exchangeValues[2])
        returns (bool)
    {
        bytes32 message = keccak256(
            abi.encodePacked(
                exchangeValues[0],
                exchangeValues[1],
                addresses[0],
                addresses[1],
                exchangeValues[2]
            )
        );
        address signer = ECDSA.recover(message, sig);
        require(signer == SignerAddress, "Incorrect signature.");

        uint256 fee = _calculateExchangeFee(msg.sender, exchangeValues[1], addresses);
        _exchangeTransfers([exchangeValues[0], exchangeValues[1], fee, salt], recipient, addresses, true);
        emit ExchangeAndTransfer(addresses[0], addresses[1], exchangeValues[0], exchangeValues[1], fee, recipient);
        return true;
    }
}
